import React from "react";
import  ReactDOM  from "react-dom";

function getTime(){
    var time = new Date().toLocaleTimeString();
    return time
}

ReactDOM.render(
    <>
    <h1>{getTime}</h1>
    </>,
    document.getElementById("root")
)
